INSERT INTO `v1_1af99c2b155dc6ae73392b7bbe11d71a6ede631b13dfa6a8418b8d73dacb0aff` VALUES (0, 0, "ねぇねぇ、騎士クン\n手伝ってあげようよ～", "ヒヨリでっす♪\n元気いっぱいがんばるよ♪", 0, "お！\nあそこに困ってそうな人発見！", 1, 0, 1.4, 1001, 1, 2, 0, "春咲 ひより", 1);
INSERT INTO `v1_1af99c2b155dc6ae73392b7bbe11d71a6ede631b13dfa6a8418b8d73dacb0aff` VALUES (0, 0, "わ、わたし、\nなに言ってるんだろ\nあはは…", "みんなみたいに\nわたしも強くならなきゃ", 0, "大切な人を\n守れるようになりたい…って", 1, 0, 1.4, 1002, 1, 2, 0, "草野 優衣", 1);
INSERT INTO `v1_1af99c2b155dc6ae73392b7bbe11d71a6ede631b13dfa6a8418b8d73dacb0aff` VALUES (0, 0, "少しは磨かれると思いますよ。", "フェンシングを始めてみては？", 0, "キミに必要な集中力と感性が", 1, 0, 1.4, 1003, 1, 2, 0, "士条 怜", 1);
INSERT INTO `v1_1af99c2b155dc6ae73392b7bbe11d71a6ede631b13dfa6a8418b8d73dacb0aff` VALUES (0, 0, "みそぎはねぇ、\nかくれんぼやりたい！", "ねぇ、にいちゃん！", 0, "今日はなにして遊ぶ？", 1, 0, 1.5, 1004, 1, 2, 0, "穂高 みそぎ", 1);
INSERT INTO `v1_1af99c2b155dc6ae73392b7bbe11d71a6ede631b13dfa6a8418b8d73dacb0aff` VALUES (0, 0, "私といっしょに…\nいかない？", "風宮あかりです", 0, "ねぇ…", 1, 0, 1.4, 1006, 1, 2, 0, "風宮 あかり", 1);
INSERT INTO `v1_1af99c2b155dc6ae73392b7bbe11d71a6ede631b13dfa6a8418b8d73dacb0aff` VALUES (0, 0, "食べ物の恨みは怖いのー", "出雲宮子なのー", 0, "プリンたべたいのー", 1, 0, 1.5, 1007, 1, 2, 0, "出雲 宮子", 1);
INSERT INTO `v1_1af99c2b155dc6ae73392b7bbe11d71a6ede631b13dfa6a8418b8d73dacb0aff` VALUES (0, 0, "いいよ。\n見られることは運命さ…", "ボクは虹村雪。", 0, "キミもボクの美貌に\n吸い寄せられたんだね。", 1, 0, 1.4, 1008, 1, 2, 0, "虹村 雪", 1);
INSERT INTO `v1_1af99c2b155dc6ae73392b7bbe11d71a6ede631b13dfa6a8418b8d73dacb0aff` VALUES (0, 0, "人呼んで「疾風の冥姫」!!", "フッ…聞いて後悔するがいい！", 0, "我が真名は\nアンネローゼ・フォン・シュテッヒパルム！", 1, 0, 1.4, 1009, 1, 2, 0, "柊杏奈", 1);
INSERT INTO `v1_1af99c2b155dc6ae73392b7bbe11d71a6ede631b13dfa6a8418b8d73dacb0aff` VALUES (0, 0, "ほんまおおきにやわ～♪", "マホマホ王国のプリンセス、\nまほ姫どす", 0, "うさぎさん、\n運命の王子はんに巡りあわせてくれて", 1, 0, 1.5, 1010, 1, 2, 0, "姫宮 真歩", 1);
INSERT INTO `v1_1af99c2b155dc6ae73392b7bbe11d71a6ede631b13dfa6a8418b8d73dacb0aff` VALUES (0, 0, "ここで会ったが\n100年目～！", "衣之咲璃乃です！", 0, "生き別れたお兄ちゃんを探して\n三千世界！", 1, 0, 1.4, 1011, 1, 2, 0, "衣之咲 璃乃", 1);
INSERT INTO `v1_1af99c2b155dc6ae73392b7bbe11d71a6ede631b13dfa6a8418b8d73dacb0aff` VALUES (0, 0, "…って、お願い！\n誰にも言わないでおいて～！", "私はハツネ、\n結構強いんだよ。\nきらーん☆", 0, "ち、超能力って…\n何のことかな～？", 1, 0, 1.4, 1012, 1, 2, 0, "柏崎 初音", 1);
INSERT INTO `v1_1af99c2b155dc6ae73392b7bbe11d71a6ede631b13dfa6a8418b8d73dacb0aff` VALUES (0, 0, "ヒデサイまぢ\nGF（グッドフィーリング）～♪", "ちょす！\n美波鈴奈だよ～♪", 0, "一応カリスマ読モJKやってまっす！", 1, 0, 1.4, 1016, 1, 2, 0, "美波 鈴奈", 1);
INSERT INTO `v1_1af99c2b155dc6ae73392b7bbe11d71a6ede631b13dfa6a8418b8d73dacb0aff` VALUES (0, 0, "でも、沖縄もとってもいいとこさー", "はいたーい。\n喜屋武香織さー。", 0, "東京は遊園地みたいなところさー", 1, 0, 1.4, 1017, 1, 2, 0, "喜屋武 香織", 1);
INSERT INTO `v1_1af99c2b155dc6ae73392b7bbe11d71a6ede631b13dfa6a8418b8d73dacb0aff` VALUES (0, 0, "イオちゃんって呼んでね。", "支倉伊緒です。", 0, "先生って呼ばれるのは\nくすぐったいから", 1, 0, 1.4, 1018, 1, 2, 0, "支倉 伊緒", 1);
INSERT INTO `v1_1af99c2b155dc6ae73392b7bbe11d71a6ede631b13dfa6a8418b8d73dacb0aff` VALUES (0, 0, "ミミをおいてかないでぇ～", "ふえ…？\nミミ、むずかしいこと\nよくわかんない…", 0, "あ！/\お兄ちゃ～ん\nまってよ～", 1, 0, 1.5, 1020, 1, 2, 0, "茜 ミミ", 1);
INSERT INTO `v1_1af99c2b155dc6ae73392b7bbe11d71a6ede631b13dfa6a8418b8d73dacb0aff` VALUES (0, 0, "ふぇぇぇぇぇん……", "あ…あの…えっと…\n栗…林…くるみ…です……", 0, "あの……\nふぇ……", 1, 0, 1.5, 1021, 1, 2, 0, "栗林 くるみ", 1);
INSERT INTO `v1_1af99c2b155dc6ae73392b7bbe11d71a6ede631b13dfa6a8418b8d73dacb0aff` VALUES (0, 0, "なんてありがとうございます！", "風宮よりです。\nあああああ！", 0, "こんな私に貴重な時間を\n割いていただき、", 1, 0, 1.4, 1022, 1, 2, 0, "風宮 より", 1);
INSERT INTO `v1_1af99c2b155dc6ae73392b7bbe11d71a6ede631b13dfa6a8418b8d73dacb0aff` VALUES (0, 0, "私こっち行きたいー\nね、早く早くー", "私、アヤネ！\nぷうきちと一緒についてってあげるね！", 0, "おにいちゃんどこいくの？\nえ？", 1, 0, 1.5, 1023, 1, 2, 0, "北条 綾音", 1);
INSERT INTO `v1_1af99c2b155dc6ae73392b7bbe11d71a6ede631b13dfa6a8418b8d73dacb0aff` VALUES (0, 0, "これて何か違う…\nあああすみません！", "わっ…わっ…私、\n天野すずめといいます！", 0, "ふ、不束者ですが\nどうぞ末永く…って、", 1, 0, 1.4, 1025, 1, 2, 0, "天野 すずめ", 1);
INSERT INTO `v1_1af99c2b155dc6ae73392b7bbe11d71a6ede631b13dfa6a8418b8d73dacb0aff` VALUES (0, 0, "離しませんわ………\n絶対に…!!", "……クスクス…私は\n…倉石恵理子……", 0, "あなたは…運命の……\n伴侶……", 1, 0, 1.4, 1027, 1, 2, 0, "倉石 恵理子", 1);
INSERT INTO `v1_1af99c2b155dc6ae73392b7bbe11d71a6ede631b13dfa6a8418b8d73dacb0aff` VALUES (0, 0, "…そうでしょ？？", "佐々木咲恋よ。\nねえ、世の中に無駄なことが\n多すぎると思わない？", 0, "その無駄を省くことができれば、\nもっと余裕のある暮らしができるっ！", 1, 0, 1.4, 1028, 1, 2, 0, "佐々木 咲恋", 1);
INSERT INTO `v1_1af99c2b155dc6ae73392b7bbe11d71a6ede631b13dfa6a8418b8d73dacb0aff` VALUES (0, 0, "あはは、\n私もまだまだだなぁ～", "桜井望だよ！\nよろしくねっ", 0, "ぇっと…\nキミ、私のこと知らないの?!", 1, 0, 1.4, 1029, 1, 2, 0, "桜井 望", 1);
INSERT INTO `v1_1af99c2b155dc6ae73392b7bbe11d71a6ede631b13dfa6a8418b8d73dacb0aff` VALUES (0, 0, "ショーグン、\nワタシと一緒に天下統一デース！", "デケデケデンっ！", 0, "初めまして、\n私はニノン・ジュベール申すデス！", 1, 0, 1.4, 1030, 1, 2, 0, "ニノン・ジュベール", 1);
INSERT INTO `v1_1af99c2b155dc6ae73392b7bbe11d71a6ede631b13dfa6a8418b8d73dacb0aff` VALUES (0, 0, "おかしいですね……", "上喜しのぶです。\n手元のドクロが父です。", 0, "でもって私の隣にいるのが……\nえ、見えない？", 1, 0, 1.4, 1031, 1, 2, 0, "上喜 しのぶ", 1);
INSERT INTO `v1_1af99c2b155dc6ae73392b7bbe11d71a6ede631b13dfa6a8418b8d73dacb0aff` VALUES (0, 0, "そう、\nオラのボケに突っ込める相方が…！", "目指すはビッグな\nお笑い芸人だっぺ！", 0, "けんども\nそれには足りないモンが…", 1, 0, 1.5, 1033, 1, 2, 0, "野戸まひる", 1);
INSERT INTO `v1_1af99c2b155dc6ae73392b7bbe11d71a6ede631b13dfa6a8418b8d73dacb0aff` VALUES (0, 0, "ちょ\nちょっと一杯飲んできます…！", "あの…私…綾瀬ゆかりです…\nあの…ごめんなさい！", 0, "ちょっと緊張しちゃって…", 1, 0, 1.4, 1034, 1, 2, 0, "綾瀬 ゆかり", 1);
INSERT INTO `v1_1af99c2b155dc6ae73392b7bbe11d71a6ede631b13dfa6a8418b8d73dacb0aff` VALUES (0, 0, "これ以上お話しすることは…\nないです！", "氷川鏡華…です", 0, "知らない人とは話しちゃいけないので", 1, 0, 1.5, 1036, 1, 2, 0, "氷川 鏡華", 1);
INSERT INTO `v1_1af99c2b155dc6ae73392b7bbe11d71a6ede631b13dfa6a8418b8d73dacb0aff` VALUES (0, 0, "私体が弱いから、\n30分に一度休憩しないと\nいけないんです。", "柏崎…栞です。", 0, "……あ、アラーム。", 1, 0, 1.4, 1038, 1, 2, 0, "柏崎 栞", 1);
INSERT INTO `v1_1af99c2b155dc6ae73392b7bbe11d71a6ede631b13dfa6a8418b8d73dacb0aff` VALUES (0, 0, "野に咲く花が、\n唯一の話相手です。", "ふ、双葉碧です。", 0, "私、一人も友達がいなくて……", 1, 0, 1.4, 1040, 1, 2, 0, "双葉 碧", 1);
INSERT INTO `v1_1af99c2b155dc6ae73392b7bbe11d71a6ede631b13dfa6a8418b8d73dacb0aff` VALUES (0, 0, "そう思っています。", "三角千歌です。", 0, "私の歌声で、\n皆さんが幸せになってくれたらいいなって…", 1, 0, 1.4, 1042, 1, 2, 0, "三角 千歌", 1);
INSERT INTO `v1_1af99c2b155dc6ae73392b7bbe11d71a6ede631b13dfa6a8418b8d73dacb0aff` VALUES (0, 0, "う、疑ってすまなかったな…", "安芸真琴だ。", 0, "あぁ？\nお前のそいつの仲間か？", 1, 0, 1.4, 1043, 1, 2, 0, "安芸 真琴", 1);
INSERT INTO `v1_1af99c2b155dc6ae73392b7bbe11d71a6ede631b13dfa6a8418b8d73dacb0aff` VALUES (0, 0, "わらわの偉大な力に\nひれ伏すがいい！\nはっはっは！", "わらわこそは夜を総べる者！", 0, "生けとし生ける全ての者よ！", 1, 0, 1.4, 1044, 1, 2, 0, "イリヤ・オーンスタイン", 1);
INSERT INTO `v1_1af99c2b155dc6ae73392b7bbe11d71a6ede631b13dfa6a8418b8d73dacb0aff` VALUES (0, 0, "ｌク、クウカに何かご用ですか!?", "そこで騎士は妖精を乱暴に……", 0, "ぐふふふふ……はっ！", 1, 0, 1.4, 1045, 1, 2, 0, "遠見 空花", 1);
INSERT INTO `v1_1af99c2b155dc6ae73392b7bbe11d71a6ede631b13dfa6a8418b8d73dacb0aff` VALUES (0, 0, "う～ん…\n猫ってホントに最高にゃ～♪", "宮坂たまきにゃ♪\n猫はいいにゃよ？", 0, "自由気ままで♪\n寝て遊んで、食べてケンカして…", 1, 0, 1.4, 1046, 1, 2, 0, "宮坂たまき", 1);
INSERT INTO `v1_1af99c2b155dc6ae73392b7bbe11d71a6ede631b13dfa6a8418b8d73dacb0aff` VALUES (0, 0, "…と思ったら\nバイトの時間だ！\nまたあとでね！", "大神美冬よ！", 0, "それでは早速クエストに…", 1, 0, 1.4, 1048, 1, 2, 0, "大神 美冬", 1);
INSERT INTO `v1_1af99c2b155dc6ae73392b7bbe11d71a6ede631b13dfa6a8418b8d73dacb0aff` VALUES (0, 0, "お姉ちゃんがぜ～んぶ\nやってあげるからね！", "星野静流だよ！", 0, "クエストもバトルも\n掃除も洗濯も", 1, 0, 1.4, 1049, 1, 2, 0, "星野静流", 1);
INSERT INTO `v1_1af99c2b155dc6ae73392b7bbe11d71a6ede631b13dfa6a8418b8d73dacb0aff` VALUES (0, 0, "学校では誰もが憧れる\nアイドル的な存在ってやつよ♪", "アタシは玉泉美咲。", 0, "見ての通りの\nセクシー美少女で", 1, 0, 1.5, 1050, 1, 2, 0, "玉泉美咲", 1);
INSERT INTO `v1_1af99c2b155dc6ae73392b7bbe11d71a6ede631b13dfa6a8418b8d73dacb0aff` VALUES (0, 0, "？？？？", "？？？", 0, "？？？？", 1, 0, 1.4, 1052, 1, 2, 0, "リマ", 1);
INSERT INTO `v1_1af99c2b155dc6ae73392b7bbe11d71a6ede631b13dfa6a8418b8d73dacb0aff` VALUES (0, 0, "そ、そこまでいうなら\nもらってやる", "モニカ・ヴァイスヴィントだ。", 0, "菓子でつろうなどと\n稚拙な策を……", 1, 0, 1.5, 1053, 1, 2, 0, "モニカ・ヴァイスヴィント", 1);
INSERT INTO `v1_1af99c2b155dc6ae73392b7bbe11d71a6ede631b13dfa6a8418b8d73dacb0aff` VALUES (0, 0, "そ、そこまでいうなら\nもらってやる", "モニカ・ヴァイスヴィントだ。", 0, "菓子でつろうなどと\n稚拙な策を……", 1, 0, 1.5, 1058, 1, 2, 0, "ペコリーヌ", 1);
INSERT INTO `v1_1af99c2b155dc6ae73392b7bbe11d71a6ede631b13dfa6a8418b8d73dacb0aff` VALUES (0, 0, "そ、そこまでいうなら\nもらってやる", "モニカ・ヴァイスヴィントだ。", 0, "菓子でつろうなどと\n稚拙な策を……", 1, 0, 1.5, 1059, 1, 2, 0, "コッコロ", 1);
INSERT INTO `v1_1af99c2b155dc6ae73392b7bbe11d71a6ede631b13dfa6a8418b8d73dacb0aff` VALUES (0, 0, "そ、そこまでいうなら\nもらってやる", "モニカ・ヴァイスヴィントだ。", 0, "菓子でつろうなどと\n稚拙な策を……", 1, 0, 1.5, 1060, 1, 2, 0, "キャル", 1);
